const initialState = {
  ur: 0,
  cgpa: 0,
  aptitudescore: 0
};

const reducer = (state = initialState, action = {}) => {
  console.log("hey");
  switch (action.type) {
    case "UPDATE UR":
      return {
        ...state,
        ur: action.data
      };
      break;
    case "UPDATE CGPA":
      return {
        ...state,
        cgpa: action.data
      };
      break;
    case "ADD FIFTY":
      return {
        ...state,
        aptitudescore: state.aptitudescore + 50
      };
      break;
    case "ADD TWENTY":
      return {
        ...state,
        aptitudescore: state.aptitudescore + 20
      };
      break;
    default:
      return state;
  }
};

export default reducer;
